package com.aiidc.env.ergs.constant;

import java.util.Date;

/**
 * @author jiabin fan
 *
 */
public class InforPub {
	private String pf;//排放
	private String cllb;//车辆类别
	private String jkc;//进口车
	private String hhdl;//混合动力
	private String acar;//单车认证
	private String njlhxs;//耐久标准推荐劣化系数
	private String rynjlhxs;//蒸发加油排放耐久推荐劣化系数
	private Long cxid;
	public String getPf() {
		return pf;
	}
	public void setPf(String pf) {
		this.pf = pf;
	}
	public String getCllb() {
		return cllb;
	}
	public void setCllb(String cllb) {
		this.cllb = cllb;
	}
	public String getJkc() {
		return jkc;
	}
	public void setJkc(String jkc) {
		this.jkc = jkc;
	}
	public String getHhdl() {
		return hhdl;
	}
	public void setHhdl(String hhdl) {
		this.hhdl = hhdl;
	}
	public String getAcar() {
		return acar;
	}
	public void setAcar(String acar) {
		this.acar = acar;
	}
	public String getNjlhxs() {
		return njlhxs;
	}
	public void setNjlhxs(String njlhxs) {
		this.njlhxs = njlhxs;
	}
	public String getRynjlhxs() {
		return rynjlhxs;
	}
	public void setRynjlhxs(String rynjlhxs) {
		this.rynjlhxs = rynjlhxs;
	}
	public Long getCxid() {
		return cxid;
	}
	public void setCxid(Long cxid) {
		this.cxid = cxid;
	}
	
}
